44b\\u0439 \\u0438\\u043d\\u0441\\u0442\\u0440\\u0443\\u043a\\u0442\\u043e\\u0440 \\u0442\\u0440\\u0435\\u043d\\u0430\\u0436\\u0435\\u0440\\u043d\\u043e\\u0433\\u043e \\u0437\\u0430\\u043b\\u0430, \\u0443\\u0447\\u0430\\u0441\\u0442\\u043d\\u0438\\u043a \\u0435\\u0436\\u0435\\u0433\\u043e\\u0434\\u043d\\u044b\\u0445 \\u043a\\u043e\\u043d\\u0432\\u0435\\u043d\\u0446\\u0438\\u0439 NIKE, \\u0443\\u0447\\u0430\\u0441\\u0442\\u043d\\u0438\\u043a \\u043c\\u0430\\u0441\\u0442\\u0435\\u0440-\\u043a\\u043b\\u0430\\u0441\\u0441\\u043e\\u0432 \\u043f\\u043e \\u043d\\u0430\\u043f\\u0440\\u0430\\u0432\\u043b\\u0435\\u043d\\u0438\\u044f\\u043c \\u00ab\\u0424\\u0443\\u043d\\u043a\\u0446\\u0438\\u043e\\u043d\\u0430\\u043b\\u044c\\u043d\\u044b\\u0439 \\u0441\\u0442\\u0435\\u043f\\u00bb, \\u00abCross-Fit\\u00bb, \\u0424\\u0443\\u043d\\u043a\\u0446\\u0438\\u043e\\u043d\\u0430\\u043b\\u044c\\u043d\\u044b\\u0435 \\u043f\\u0435\\u0442\\u043b\\u0438 \\u00abTRX\\u00bb, \\u0422\\u0430\\u0439-\\u0411\\u043e, \\u043f\\u0438\\u043b\\u0430\\u0442\\u0435\\u0441, \\u0441\\u0442\\u0440\\u0435\\u0439\\u0442\\u0447\\u0438\\u043d\\u0433. \\u041d\\u0430\\u0433\\u0440\\u0430\\u0436\\u0434\\u0435\\u043d\\u0430 \\u043d\\u0435\\u043e\\u0434\\u043d\\u043e\\u043a\\u0440\\u0430\\u0442\\u043d\\u043e \\u0434\\u0438\\u043f\\u043b\\u043e\\u043c\\u0430\\u043c\\u0438 \\u0432 \\u043d\\u043e\\u043c\\u0438\\u043d\\u0430\\u0446\\u0438\\u0438 \\u00ab\\u041b\\u0443\\u0447\\u0448\\u0438\\u0439 \\u0442\\u0440\\u0435\\u043d\\u0435\\u0440\\u00bb 2014, 2015, 2016 \\u0433.\\u0433. \\u0421\\u0435\\u0440\\u0442\\u0438\\u0444\\u0438\\u0446\\u0438\\u0440\\u043e\\u0432\\u0430\\u043d\\u043d\\u044b\\u0439 \\u0434\\u0438\\u0435\\u0442\\u043e\\u043b\\u043e\\u0433 \\u0438 \\u043a\\u043e\\u043d\\u0441\\u0443\\u043b\\u044c\\u0442\\u0430\\u043d\\u0442 \\u043f\\u043e \\u043f\\u0438\\u0442\\u0430\\u043d\\u0438\\u044e, \\u0443\\u0447\\u0430\\u0441\\u0442\\u043d\\u0438\\u043a \\u0440\\u0430\\u0437\\u043b\\u0438\\u0447\\u043d\\u044b\\u0445 \\u0441\\u0435\\u043c\\u0438\\u043d\\u0430\\u0440\\u043e\\u0432 \\u043f\\u043e \\u0434\\u0438\\u0435\\u0442\\u043e\\u043b\\u043e\\u0433\\u0438\\u0438 \\u0438 \\u0430\\u043d\\u0430\\u0442\\u043e\\u043c\\u0438\\u0438 \\u0447\\u0435\\u043b\\u043e\\u0432\\u0435\\u043a\\u0430. \\u041e\\u0434\\u0438\\u043d \\u0438\\u0437 \\u043e\\u0441\\u043d\\u043e\\u0432\\u0430\\u0442\\u0435\\u043b\\u0435\\u0439 \\u043f\\u0440\\u043e\\u0435\\u043a\\u0442\\u0430 \\u00ab\\u0421\\u043e\\u0442\\u0432\\u043e\\u0440\\u0438 \\u0441\\u0435\\u0431\\u044f\\u00bb. \\u041b\\u0438\\u0447\\u043d\\u044b\\u0439 \\u0441\\u043f\\u043e\\u0440\\u0442\\u0438\\u0432\\u043d\\u044b\\u0439 \\u0441\\u0442\\u0430\\u0436 \\u2013 10 \\u043b\\u0435\\u0442. \\u0421\\u0442\\u0430\\u0436 \\u0440\\u0430\\u0431\\u043e\\u0442\\u044b \\u0442\\u0440\\u0435\\u043d\\u0435\\u0440\\u043e\\u043c \\u2013 8 \\u043b\\u0435\\u0442.","phone":"0505959514","social":[],"slug":"miroslava-krasnokutskaia","updated_at":"2023-01-19T10:14:41.000000Z","created_at":"2023-01-19T10:14:41.000000Z","id":17}',
