            'original' => NULL,
        'changes' => '{"name":"\\u0420\\u0423\\u0421\\u041b\\u0410\\u041d \\u0420\\u0423\\u0421\\u0410\\u041d\\u041e\\u0412","title":"\\u041f\\u0435\\u0440\\u0441\\u043e\\u043d\\u0430\\u043b\\u044c\\u043d\\u044b\\u0439 \\u0442\\u0440\\u0435\\u043d\\u0435\\u0440 \\u0442\\u0440\\u0435\\u043d\\u0430\\u0436\\u0435\\u0440\\u043d\\u043e\\u0433\\u043e \\u0437\\u0430\\u043b\\u0430","image":"http:\\/\\/localhost\\/storage\\/Ed1yWd2oHJxHudU8coLDxJhjjSVEqqwQGsdAxlTB.jpg","description":"Certi icate gym level 1 \\u041f\\u0435\\u0440\\u0441\\u043e\\u043d\\u0430\\u043b\\u044c\\u043d\\u044b\\u0439 \\u0442\\u0440\\u0435\\u043d\\u0435\\u0440 \\u0442\\u0440\\u0435\\u043d\\u0430\\u0436\\u0435\\u0440\\u043d\\u043e\\u0433\\u043e \\u0437\\u0430\\u043b\\u0430 26.07.2017 \\u0421\\u0435\\u0440\\u0442\\u0438\\u0444\\u0438\\u043a\\u0430\\u0442 \\u0442\\u0440\\u0435\\u043d\\u0438\\u043d\\u0433 \\u0441 \\u0438\\u0441\\u043f\\u043e\\u043b\\u044c\\u0437\\u043e\\u0432\\u0430\\u043d\\u0438\\u0435\\u043c \\u043f\\u043e\\u0434\\u0432\\u0435\\u0441\\u043d\\u044b\\u0445 \\u043f\\u0435\\u0442\\u0435\\u043b\\u044c \\u0422\\u0420\\u0425 09.12.2018 \\u0421\\u0435\\u0440\\u0442\\u0438\\u0444\\u0438\\u043a\\u0430\\u0442 \\u0443\\u0447\\u0430\\u0441\\u0442\\u043d\\u0438\\u043a\\u0430 Nike Training Club Convention 16-17.03.2019 Certi icate Myofascial Release \\u041c\\u0438\\u043e\\u0444\\u0430\\u0441\\u0446\\u0438\\u0430\\u043b\\u044c\\u043d\\u043e\\u0435 \\u0440\\u043e\\u0437\\u0441\\u043b\\u0430\\u0431\\u043b\\u0435\\u043d\\u0438\\u0435 26.10.2019 Certi icate Pilates Matwork(level 1) \\u041f\\u0438\\u043b\\u0430\\u0442\\u0435\\u0441 (\\u0443\\u0440\\u043e\\u0432\\u0435\\u043d\\u044c 1) 02.02.2020 \\u041f\\u0435\\u0440\\u0441\\u043e\\u043d\\u0430\\u043b\\u044c\\u043d\\u044b\\u0439 \\u0442\\u0440\\u0435\\u043d\\u0435\\u0440 \\u0442\\u0440\\u0435\\u043d\\u0430\\u0436\\u0435\\u0440\\u043d\\u043e\\u0433\\u043e \\u0437\\u0430\\u043b\\u0430 \\u0443\\u0440\\u043e\\u0432\\u0435\\u043d\\u044c 2 -personal trainer level2 \\u0412\\u044b\\u0441\\u0448\\u0435\\u0435 \\u043e\\u0431\\u0440\\u0430\\u0437\\u043e\\u0432\\u0430\\u043d\\u0438\\u0435: \\u0425\\u0430\\u0440\\u044c\\u043a\\u043e\\u0432\\u0441\\u043a\\u0438\\u0439 \\u043d\\u0430\\u0446\\u0438\\u043e\\u043d\\u0430\\u043b\\u044c\\u043d\\u044b\\u0439 \\u043f\\u0435\\u0434\\u0430\\u0433\\u043e\\u0433\\u0438\\u0447\\u0435\\u0441\\u043a\\u0438\\u0439 \\u0443\\u043d\\u0438\\u0432\\u0435\\u0440\\u0441\\u0438\\u0442\\u0435\\u0442 \\u0438\\u043c. \\u0413.\\u0421.\\u0421\\u043a\\u043e\\u0432\\u043e\\u0440\\u043e\\u0434\\u0438 , \\u0441\\u043f\\u0435\\u0446\\u0438\\u0430\\u043b\\u044c\\u043d\\u043e\\u0441\\u0442\\u044c \\u0424\\u0456\\u0437\\u0438\\u0447\\u043d\\u0430 \\u043a\\u0443\\u043b\\u044c\\u0442\\u0443\\u0440\\u0430 \\u0456 \\u0441\\u043f\\u043e\\u0440\\u0442 \\u0437\\u0430 \\u043e\\u0441\\u0432\\u0456\\u0442\\u043d\\u0456\\u043c\\u0438 \\u043f\\u0440\\u043e\\u0433\\u0440\\u0430\\u043c\\u0430\\u043c\\u0438 \\u00ab\\u0422\\u0440\\u0435\\u043d\\u0435\\u0440\\u0441\\u044c\\u043a\\u0430 \\u0434\\u0456\\u044f\\u043b\\u044c\\u043d\\u0456\\u0441\\u0442\\u044c \\u0437 \\u043e\\u0431\\u0440\\u0430\\u043d\\u043e\\u0433\\u043e \\u0432\\u0438\\u0434\\u0443 \\u0441\\u043f\\u043e\\u0440\\u0442\\u0443\\u00bb \\u0456 \\u00ab\\u0424\\u0456\\u0442\\u043d\\u0435\\u0441 \\u0442\\u0430 \\u0440\\u0435\\u043a\\u0440\\u0435\\u0430\\u0446\\u0456\\u044f\\u00bb. \\u041c\\u0430\\u0441\\u0442\\u0435\\u0440 \\u0441\\u043f\\u043e\\u0440\\u0442\\u0430 \\u043c\\u0435\\u0436\\u0434\\u0443\\u043d\\u0430\\u0440\\u043e\\u0434\\u043d\\u043e\\u0433\\u043e \\u043a\\u043b\\u0430\\u0441\\u0441\\u0430 \\u043f\\u043e \\u0441\\u0443\\u043c\\u043e, \\u043c\\u0430\\u0441\\u0442\\u0435\\u0440 \\u0441\\u043f\\u043e\\u0440\\u0442\\u0430 \\u043f\\u043e \\u0433\\u0440\\u0435\\u043a\\u043e-\\u0440\\u0438\\u043c\\u0441\\u043a\\u043e\\u0439 \\u0431\\u043e\\u0440\\u044c\\u0431\\u0435, \\u0441\\u0435\\u0440\\u0435\\u0431\\u0440\\u044f\\u043d\\u044b\\u0439 \\u0438 \\u0431\\u0440\\u043e\\u043d\\u0437\\u043e\\u0432\\u044b\\u0439 \\u041f\\u0440\\u0438\\u0437\\u0435\\u0440 \\u043a\\u0443\\u0431\\u043a\\u0430 \\u043c\\u0438\\u0440\\u0430 \\u043f\\u043e \\u0431\\u043e\\u0440\\u044c\\u0431\\u0435 \\u043d\\u0430 \\u043f\\u043e\\u044f\\u0441\\u0430\\u0445 , \\u0447\\u0435\\u043c\\u043f\\u0438\\u043e\\u043d \\u0438 \\u0431\\u0440\\u043e\\u043d\\u0437\\u043e\\u0432\\u044b\\u0439 \\u043f\\u0440\\u0438\\u0437\\u0451\\u0440 \\u043a\\u0443\\u0431\\u043a\\u0430 \\u0415\\u0432\\u0440\\u043e\\u043f\\u044b 3\\u0445-\\u043a\\u0440\\u0430\\u0442\\u043d\\u044b\\u0439 \\u0447\\u0435\\u043c\\u043f\\u0438\\u043e\\u043d \\u0415\\u0432\\u0440\\u043e\\u043f\\u044b ,3\\u0445-\\u043a\\u0440\\u0430\\u0442\\u043d\\u044b\\u0439 \\u0441\\u0435\\u0440\\u0435\\u0431\\u0440\\u044f\\u043d\\u044b\\u0439 \\u043f\\u0440\\u0438\\u0437\\u0435\\u0440 \\u0447\\u0435\\u043c\\u043f\\u0438\\u043e\\u043d\\u0430\\u0442\\u0430 \\u0415\\u0432\\u0440\\u043e\\u043f\\u044b ,\\u043c\\u043d\\u043e\\u0433\\u043e\\u043a\\u0440\\u0430\\u0442\\u043d\\u044b\\u0439 \\u0447\\u0435\\u043c\\u043f\\u0438\\u043e\\u043d \\u0438 \\u043f\\u0440\\u0438\\u0437\\u0435\\u0440 \\u0447\\u0435\\u043c\\u043f\\u0438\\u043e\\u043d\\u0430\\u0442\\u043e\\u0432 \\u0423\\u043a\\u0440\\u0430\\u0438\\u043d\\u044b ,\\u043c\\u0435\\u0436\\u0434\\u0443\\u043d\\u0430\\u0440\\u043e\\u0434\\u043d\\u044b\\u0445 \\u0438 \\u0440\\u0435\\u0433\\u0438\\u043e\\u043d\\u0430\\u043b\\u044c\\u043d\\u044b\\u0445 \\u0442\\u0443\\u0440\\u043d\\u0438\\u0440\\u043e\\u0432 \\u043f\\u043e \\u0433\\u0440\\u0435\\u043a\\u043e-\\u0440\\u0438\\u043c\\u0441\\u043a\\u043e\\u0439 \\u0431\\u043e\\u0440\\u044c\\u0431\\u0435 \\u0438 \\u0431\\u043e\\u0440\\u044c\\u0431\\u0435 \\u0441\\u0443\\u043c\\u043e","phone":null,"social":[],"slug":"ruslan-rusanov","updated_at":"2023-01-19T14:08:30.000000Z","created_at":"2023-01-19T14:08:30.000000Z","id":30}',
