\u0432\\u0438\\u043b\\u044c\\u043d\\u043e\\u0435 \\u0434\\u044b\\u0445\\u0430\\u043d\\u0438\\u0435 \\u0438 \\u043c\\u044b\\u0441\\u043b\\u0435\\u043d\\u043d\\u0443\\u044e \\u043a\\u043e\\u043d\\u0446\\u0435\\u043d\\u0442\\u0440\\u0430\\u0446\\u0438\\u044e \\u043d\\u0430 \\u0442\\u043e\\u0439 \\u043c\\u044b\\u0448\\u0446\\u0435, \\u043d\\u0430 \\u043a\\u043e\\u0442\\u043e\\u0440\\u0443\\u044e \\u044d\\u0442\\u0438 \\u0443\\u043f\\u0440\\u0430\\u0436\\u043d\\u0435\\u043d\\u0438\\u044f \\u043d\\u0430\\u043f\\u0440\\u0430\\u0432\\u043b\\u0435\\u043d\\u044b. \\u0421\\u0438\\u0441\\u0442\\u0435\\u043c\\u0430 \\u00ab\\u041f\\u0438\\u043b\\u0430\\u0442\\u0435\\u0441\\u00bb \\u0438\\u043c\\u0435\\u0435\\u0442 \\u043e\\u0433\\u0440\\u043e\\u043c\\u043d\\u0443\\u044e \\u043f\\u043e\\u043f\\u0443\\u043b\\u044f\\u0440\\u043d\\u043e\\u0441\\u0442\\u044c \\u0441\\u0440\\u0435\\u0434\\u0438 \\u0442\\u0430\\u043a\\u0438\\u0445 \\u0437\\u0430\\u0440\\u0443\\u0431\\u0435\\u0436\\u043d\\u044b\\u0445 \\u0437\\u043d\\u0430\\u043c\\u0435\\u043d\\u0438\\u0442\\u043e\\u0441\\u0442\\u0435\\u0439 \\u043a\\u0430\\u043a \\u041c\\u0430\\u0434\\u043e\\u043d\\u043d\\u0430, \\u041c\\u043e\\u043d\\u0438\\u043a\\u0430 \\u0411\\u0435\\u043b\\u043b\\u0443\\u0447\\u0447\\u0438, \\u0421\\u0438\\u043d\\u0434\\u0438 \\u041a\\u0440\\u043e\\u0443\\u0444\\u043e\\u0440\\u0434, \\u0414\\u0436\\u0443\\u043b\\u0438\\u044f \\u0420\\u043e\\u0431\\u0435\\u0440\\u0442\\u0441, \\u0414\\u0436\\u0435\\u043d\\u043d\\u0438\\u0444\\u0435\\u0440 \\u042d\\u043d\\u0438\\u0441\\u0442\\u043e\\u043d, \\u041a\\u043b\\u0430\\u0443\\u0434\\u0438\\u044f \\u0428\\u0438\\u0444\\u0444\\u0435\\u0440, \\u041a\\u0430\\u043c\\u0435\\u0440\\u043e\\u043d \\u0414\\u0438\\u0430\\u0441 \\u0438 \\u0441\\u0440\\u0435\\u0434\\u0438 \\u043d\\u0430\\u0448\\u0438\\u0445 \\u0443\\u043a\\u0440\\u0430\\u0438\\u043d\\u0441\\u043a\\u0438\\u0445 \\u0437\\u0432\\u0435\\u0437\\u0434 \\u2013 \\u0415\\u043b\\u0435\\u043d\\u044b \\u041a\\u0440\\u0430\\u0432\\u0